UML:TaggedValue.value:
A LinearOrientationProperties  instance is a kind of GeometricDescriptionValue, and SHALL inherit the properties from that class;
A LinearOrientationProperties instance MAY have additional properties for plunge and trend  that are numeric range value, and a directed property that is a code value indicating whether the orientation has a distinct polarity.
At least one of plunge or trend SHALL have a value that is not nil.

A Borehole SHALL have the following properties:
exactly one 'referenceLocation' that is specified by an OriginPosition feature;
one or more 'downholeDrillingDetails' that is specified by a DrillingDetails entity;
one or more 'logElement' that is specified by a MappedIntervale feature;
one or more 'indexData' that is specified by a BoreholeDetails entity.
Informative:
The referenceLocation is a geospatially located 3-D point that is the origin of the boring that created the hole, and is the origin of a linear spatial reference system defined along the trace of the borehole.
